.nav {
    background-color: rgba(55,55,55, 0.25);

    border: 3px double black;
    border-radius: 2%;

    padding: 1%;
    margin: 0% 0.5%;

    left: 0%;
    top: 50%;

    transform: translate(0%, -50%)

}

.navItem {
    cursor: pointer;


    text-align: center;

    font-size: 100%;
    color: white;

    background-color: var(--navItem_background-color);

    border: 1px solid black;
    border-radius: 5%;
    padding: 2.5% 1%;
    margin: 2.5% 0%;
}

.navItem:hover {
    background-color: var(--navItem-hover_background-color);

    border: 1px solid white;
}

.navItem:active {
    background-color: var(--navItem-active_background-color);

    border: 1px solid white;
}


.navContainer {
    width: 100%;

    padding: 0% 0%;
    margin: 5% 0%;
}

.navButton {
    //position: relative;
    cursor: pointer;

    text-align: center;

    font-size: 150%;
    color: white;

    background-color: rgb(0,0,0,0.5);

    padding: 0.25%;
    margin: 0.25% 0.25%;

    border: 3px double black;
    border-radius: 1%;
}

.navButton:hover {
    background-color: rgba(0,0,0,0.9);

    border: 3px double white;
}

.navButton:active {
    background-color: rgba(155,155,155,0.95);

    border: 3px double white;
}

.navLabel {
    font-size: 100%;
    color: white;

    background-color: rgba(25, 25, 25, 0.3);

    text-align: center;

    padding: 0.5%;
    margin: 0.5% 0.25%;

    border: 2px solid rgb(0,0,0,0.5);
    border-radius: 1%;
}

